import React from "react";
import { CardContent, Typography, Grid } from "@material-ui/core";

export default function Cards(props) {
  return (
    <Grid item component={Card}>
      <CardContent>
        <Typography>{props.text}</Typography>
      </CardContent>
    </Grid>
  );
}
